    false,nt"url": null,nt"notes": "This narrative report for National Elk
    Refuge outlines Refuge accomplishments from January through April of 1955. The report
    begins by summarizing the weather conditions and food and cover during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, raptors, fish, and disease- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. The public
    relations section of the report describes recreational uses, Refuge visitors, and
    Refuge participation. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
